from mysite.channels.models import *from django.contrib import adminclass ChannelAdmin(admin.ModelAdmin):    fieldsets = [        (None, {'fields': ['title', 'path', 'is_disabled']}),        ('Date information', {'fields': ['created_at', 'updated_at'], 'classes': ['collapse']}),    ]    list_display = ('title', 'path', 'is_disabled', 'created_at', 'updated_at')    list_filter = ['created_at']    search_fields = ['title']admin.site.register(Channel, ChannelAdmin)admin.site.register(Configure)